	 * @return Nette\Http\Session
	 */
	protected function createServiceSession()
	{
		$service = new Nette\Http\Session($this->httpRequest, $this->httpResponse);
		$service->setExpiration('+30days');
		return $service;
	}


	/**
	 * @return StatsManager
	 */
	protected function createServiceStatsmanager()
	{
		$service = new StatsManager($this->database);
		return $service;
	}


	/**
	 * @return Nette\Security\User
	 */
	protected function createServiceUser()
	{
		$service = new Nette\Security\User($this->{'nette.userStorage'}, $this);
		Nette\Diagnostics\Debugger::$bar->addPanel(new Nette\Security\Diagnostics\UserPanel($service));
		return $service;
	}


	/**
	 * @return UsersManager
	 */
	protected function createServiceUsersmanager()
	{
		$service = new UsersManager($this->database);
		return $service;
	}


	public function initialize()
	{
		date_default_timezone_set('Europe/Prague');
		Nette\Diagnostics\Debugger::$email = 'admin@mudrweb.cz';
		Nette\Diagnostics\Debugger::$strictMode = TRUE;
		Nette\Diagnostics\Debugger::$bar->addPanel(new Nette\DI\Diagnostics\ContainerPanel($this));
		Nette\Caching\Storages\FileStorage::$useDirectories = TRUE;

		$this->session->exists() && $this->session->start();
		header('X-Frame-Options: DENY');
	}

}



